import { useState,useContext } from 'react';
import { Button, ButtonGroup } from 'react-bootstrap';
import Form from 'react-bootstrap/Form';
import Layout from "../../components/ui/Layout";
import { UserContext } from "../../context/UserContext";
import LogoutButton from '../../components/form/LogoutButton';
import { useNavigate } from "react-router-dom";

const defaultFormFields = {
    username: '',
    password: '',
    confirmPassword: '',
}

const Register = () => {
    const [formFields, setFormFields] = useState(defaultFormFields);
    const {username, password, confirmPassword} = formFields;

    const handleChange = (event) => {
        const { name, value } = event;
        setFormFields({...formFields,[name]:value});
    }
    
    return (
        <Layout>
            <h3>Register Form</h3>
            <form className="needs-validation" noValidate>
  <div className="form-row">
    <div className="col-md-4 mb-3">
      <label htmlFor="validationTooltipUsername">Username</label>
      <div className="input-group">
        <input type="text" name="username" className="form-control" id="validationTooltipUsername" placeholder="Username" aria-describedby="validationTooltipUsernamePrepend" required />
        <div className="invalid-tooltip">
          Please choose a unique and valid username.
        </div>
      </div>
    </div>
    <div className="form-group row">
    <label htmlFor="inputPassword3" className="col-sm-2 col-form-label">Password</label>
    <div className="col-sm-10">
      <input type="password" name="password" className="form-control" id="inputPassword3" placeholder="Password" />
    </div>
  </div>

  {/* AGREGAR CHECKBOX QUE NO PUEDA DESCHEQUEAR*/}
  <div className="col-md-4 mb-3">
      <label htmlFor="validationTooltipUsername">Role</label>
      <div className="input-group">
        <input type="text" className="form-control" id="validationTooltipUsername" placeholder="User" aria-describedby="validationTooltipUsernamePrepend" />
      </div>
    </div>
  </div>
  <button className="btn btn-primary" type="submit">Submit form</button>
</form>
        </Layout>
    )
}

export default Register;
